import './App.css';
import { BrowserRouter, Routes } from "react-router-dom";
import NavBar from './components/NavBar'
import Home from './pages/Home'
import Cart from './pages/Cart';

function App() {
  return (
    <BrowserRouter>

      <div className="App">
        <Routes path="/" exact>
          <Home />
        </Routes>
        <Routes path="/cart">
          <Cart />
        </Routes>
      </div>
    </BrowserRouter>
  );
}

export default App;
